import React from 'react'
import {
    
    Switch,
    Route
  } from "react-router-dom";

const App=()=>{
    return(
        <div>
            <Switch>
                <Route path="/addStudent">
                    <Form />
                </Route>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>    
        </div>
    )
} 
export default App
